.sr-only {
  position: absolute;
  width: 1px;
  height: 1px;
  padding: 0;
  margin: -1px;
  overflow: hidden;
  clip: rect(0, 0, 0, 0);
  border: 0;
}

.sr-only-focusable:active, .sr-only-focusable:focus {
  position: static;
  width: auto;
  height: auto;
  margin: 0;
  overflow: visible;
  clip: auto;
}

.nav-link__li {
  -webkit-user-select: none;
     -moz-user-select: none;
      -ms-user-select: none;
          user-select: none;
}
@media (max-width: 920px) {
  .nav-link__li {
    text-align: left;
  }
}

.nav-link__link {
  display: block;
  padding: 10px 0 10px 0;
  font-family: "Montserrat", Helvetica, Arial, sans-serif;
  font-style: normal;
  font-weight: normal;
  font-size: 14px;
  line-height: 24px;
  color: #1f2041;
  opacity: 0.75;
  font-size: 0.875rem;
  line-height: 17px;
  opacity: 0.5;
  cursor: pointer;
}
.nav-link__link:visited {
  color: #1f2041;
}
@media (max-width: 1200px) {
  .nav-link__link {
    font-size: 13px;
  }
}
@media (max-width: 920px) {
  .nav-link__link {
    font-size: 16px;
    line-height: 25px;
  }
}

.button {
  height: 34px;
  background: -webkit-gradient(linear, left top, left bottom, from(#BC9CFF), to(#8BA4F9));
  background: linear-gradient(180deg, #BC9CFF 0%, #8BA4F9 100%);
  border-radius: 22px;
  cursor: pointer;
  outline: none;
  font-family: "Montserrat", Helvetica, Arial, sans-serif;
  font-style: normal;
  font-weight: 700;
  font-size: 0.75rem;
  line-height: 15px;
  color: #1f2041;
  text-transform: uppercase;
  color: #fff;
}
.button:active {
  opacity: 0.5;
}

.button-inverse {
  height: 34px;
